import React from "react";
import NextLink from "next/link";
import { Box, Flex } from "@chakra-ui/core";

interface NavBarProps {}

const NavBar: React.FC<{}> = () => {
  return (
    <Box
      p={"absolute"}
      w={"100vw"}
      h={"80px"}
      backgroundColor={"#333"}
      display={"flex"}
    >
      {/* <InnerBar> */}
      <NextLink href="/">
        <Box style={{ cursor: "pointer", color: "#fff" }}>LOGO</Box>
      </NextLink>
      <Box
        display="flex"
        justifyContent="center"
        marginLeft="auto"
        marginRight="10%"
      >
        <Box style={{ color: "#fff" }}>
          <NextLink href="/catagories">CATAGORIES</NextLink>
        </Box>
        <Box style={{ color: "#fff" }}>
          <NextLink href="/Box">ABOUT</NextLink>
        </Box>
        <Box>
          <input
            placeholder="🔍"
            style={{
              outline: "none",
              width: "7vw",
              textIndent: "5px",
              height: "30px",
              fontSize: "15px",
            }}
          ></input>
        </Box>
      </Box>
    </Box>
  );
};

export default NavBar;
